import React from 'react'
import { Link } from 'react-router-dom';


 function Home() {
  return (
    <div>
    <div id='home'>Home Luanda Kotieno</div>
        <img src="./" alt="a photo of the luanda view" title="Welcome home"/>
       <p>luanda Kotieno is a centere located in south uyoma ward in Siaya county<br/>Luanda kotieno was named after the great OTIENO of siamba B village <br/>
        There are severall aconomic activities practiced as the main is <strong>fishing</strong>as people of luanda kotieno live along the <b>lake victoria kenya</b>
        </p>
    </div>
  )
}


export default Home;
